import React from 'react';

const ImageList = (props) => {
    console.log(props);
    return (
        <div className="ui segment">
            <form className="ui form" onSubmit={this.onFormSubmit}>
                <div className="field">
                    <label>Image Search</label>
                </div>
            </form>
        </div>
    )
};

export default ImageList;
